import React, { Component } from 'react';

import OrgForm from './OrgForm.js';
import SupplyForm from './SupplyForm.js';

const steps =[
    {id: "orgInfo"},
    {id: "supplyInfo"}
];
export default function AddSupply(){
    const { step, navigation } = useStep({ initialStep: 0, steps });
    const {id} = step;
    switch(id){
        case "orgInfo":
            return <OrgForm/>;
        case "supplyInfo":
            return <SupplyForm/>
        default:
            return null;
    }
}
